import React, { useEffect, useState } from "react";
import { getMessage } from "./Api";

function App() {
  const [message, setMessage] = useState("Loading...");

  useEffect(() => {
    getMessage().then((msg) => setMessage(msg));
  }, []);

  return (
    <div style={{ textAlign: "center", marginTop: "50px", fontSize: "24px" }}>
      {message}
    </div>
  );
}

export default App;
